import React from 'react';
import logo from './logo.svg';
import './App.css';

function entrar(){
  console.log("Has entrado a tu cuenta");
}

function App() {
  return (
    <div className="App">
      <segment className="BackColor">
        <h4>Usuario</h4>
        <input type="text"/>
        <h4>Contrase√±a</h4>
        <input type="password"/>

        <br/>
        <button type="button" className="btn btn-primary" onClick={entrar()}> Entrar </button>
        <br/>


        <a className="Font-Link" href="https://youtu.be/gpLfZUdr-KM?t=11">
          Who R U?
        </a>
      </segment>
    </div>
  );
}

export default App;
